import React from 'react'
import './index.css'

const MoneyBook = props => {
  const books = [
    { date: '1/1', item: 'お年玉', amount: 10000 },
    { date: '1/3', item: 'ケーキ', amount: -500 },
    { date: '2/1', item: '小遣い', amount: 3000 },
    { date: '2/5', item: 'マンガ', amount: -600 }
  ]
}
